import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    users: [
      ["user0", "bar", "test"],
      ["user1", "bar"],
      ["user2", "bar"],
      ["user3", "bar"],
    ],
  };

  moveToNext = (index, id) => {
    console.log("hello");
  };

  render() {
    return (
      <div className="App">
        <div className="container">
          <List blocktext={this.state.users} moveToNext={this.moveToNext} />
        </div>
      </div>
    );
  }
}

export default App;
